      "name": "2 peace ring",
      "type": "bestseller",
      "id": "ring"
    },{
      "image": pic14,
      "price": "€13.00",
      "name": "Delicate necklace",
      "type": "bestseller",
      "id": "necklace"
    },
    {
      "image": pic15,
      "price": "€8.80",
      "name": "Loop ring",
      "type": "bestseller",
      "id": "12"
    },]

  // const filtered = photos.filter(photo => {
