  //         </div>
  //       );
  //     })}
  //   </div>

  const single = photos.map((photo) =>(
    <div key={photo.id}>
      <img src={photo.image} alt={photo.price} id='pics'/>
      <p>{photo.id}</p>
      <b>{photo.price}</b>
   </div> 
  ))
    return (
        <div className='box'>
          {single}
        </div>
    );

}

export default Card;
